import React from 'react';
import './CustomerReview.css';

function CustomerReview() {
  return (
  <>
<div className='review__container'>
  <h2>Customer's Review</h2>
    <img src='images/review.svg' alt='review'/>
    
</div>
  </>
  )
}

export default CustomerReview;
